data class DataOuter(val A: List<Data>, val B: List<Data>, val C: List<Data>
                     , val D: List<Data>, val E: List<Data>, val F: List<Data>, val G: List<Data>
                     , val H: List<Data>, val J: List<Data>, val K: List<Data>
