                     , val T: List<Data>, val W: List<Data>, val X: List<Data>, val Y: List<Data>
                     , val Z: List<Data>)

data class Data(val areaCode: String, val name: String, val alias: String?, val id: Int, val parentId: Int, var key: String? = "")

class Parser {

    fun parse(jsonStr: String): List<Data> {
        val gson = Gson()
        val originalData = gson.fromJson(jsonStr, OriginalData::class.java)
        val r = mutableListOf<Data>()
        toDatas(r, originalData.data.A, "A")
        toDatas(r, originalData.data.B, "B")
        toDatas(r, originalData.data.C, "C")
        toDatas(r, originalData.data.D, "D")
        toDatas(r, originalData.data.E, "E")
        toDatas(r, originalData.data.F, "F")
        toDatas(r, originalData.data.G, "G")
        toDatas(r, originalData.data.H, "H")
        toDatas(r, originalData.data.G, "G")
        toDatas(r, originalData.data.K, "K")
        toDatas(r, originalData.data.L, "L")
        toDatas(r, originalData.data.M, "M")
        toDatas(r, originalData.data.N, "N")
        toDatas(r, originalData.data.P, "P")
        toDatas(r, originalData.data.Q, "Q")
        toDatas(r, originalData.data.R, "R")
        toDatas(r, originalData.data.S, "S")
        toDatas(r, originalData.data.T, "T")
        toDatas(r, originalData.data.X, "X")
        toDatas(r, originalData.data.Y, "Y")
        toDatas(r, originalData.data.Z, "Z")
        return r
    }

    private fun toDatas(tlist: MutableList<Data>, list: List<Data>, key: String) {
        list.forEach {
            it.key = key
            tlist.add(it)
        }
    }
